import React from 'react'

class Forecast extends React.Component {

    render() {

        for(let i = 0; i<this.props.currentForecast.list.length;  i+=1) {
            return (
                <div className="weatherTile">
                    <p>{this.props.currentForecast.list[i].dt_txt}</p>
                </div>
            )
        } 

    }
}

export default Forecast
